import React from 'react';

const GhostCounter = () => {
  return (
    <div id='wrapper' className=''>
      <button className='inline-block flex justify-center items-center rounded bg-blue-300 px-3 '>
        <h5>1</h5>
        <i className='fas z-10 fa-ghost text-gray-500 ml-1'></i>
      </button>
    </div>
  );
};

//

export default GhostCounter;
